import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import {BrowserRouter as Routes, Route} from "react-router-dom";

document.querySelector("body").style.backgroundColor = "#F7F7F7";

ReactDOM.render(
    <Route>
        <App />
    </Route>
    , document.getElementById("root"));
